    # Equation for AB40_Fibril17_Antibody_bound
    new_state['AB40_Fibril17_Antibody_bound'] = -(state['AB40_Fibril17_Antibody_bound'] * state['Microglia_cell_count'] * (state['Microglia_Hi_Fract'] * params['Microglia_CL_high_mab'] + (1 - state['Microglia_Hi_Fract']) * params['Microglia_CL_low_mAb'])) + params['fta1'] * state['Antibody_unbound_ISF'] * state['AB40_Fibril17'] 
