    new_state['AB40_Fibril17_PVS_bound'] = params['fta2'] * state['C_Antibody_unbound_PVS'] * state['AB40_Fibril17_PVS'] -((1 - params['sigma_PVS_ABeta40_bound']) * params['Q_PVS'] * state['AB40_Fibril17_PVS_bound'] / params['V_PVS']) 
