    new_state['Microglia_Hi_Fract'] = (1 + params['SmaxUp'] * state['Anti_ABeta_bound_sum'] / (params['EC50_Up'] + state['Anti_ABeta_bound_sum'])) * params['gamma_fr'] * state['Microglia_Hi_Fract'] * ((params['Microglia_Hi_fract_max'] - state['Microglia_Hi_Fract']) / (params['Microglia_Hi_fract_max'] - params['Microglia_Hi_fract_base'])) -(params['gamma_fr'] * state['Microglia_Hi_Fract']) 
